import React, { Component } from "react";
import { WooCommerce } from "./WooConnection.js";

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: []
    };
  }

 render() {
      WooCommerce.get('products?per_page=20').then(function(result) {
   // console.log(result);
    });
    return (
      <div>
       {result.map((item, i) =>{
          return <h1>{item.name}</h1>
        })}
      </div>)
  }    
}
export default Home;
